import React, {Component} from 'react'
import Active from "./activeReport/active";

class  LookMain extends Component {
    state = {
        projects: [
            {
                reps:[
                    {text: 'Проект №1', curs:"Василий"},
                    {text: 'Проект №2',curs:"Всеволод"}
                ]
            }
        ]
    }
    render(){
        return(
            <div>
                <Active
                    reps={this.state.projects[0].reps}
                    curs={this.state.projects[0].curs}
                />
            </div>
        )
    }
}
export default LookMain
